export const DayName = (date) => {


   const days = [
      "Sunday",
      "Monday",
      "Tuesday",
      "Wednesday",
      "Thursday",
      "Friday",
      "Saturday",
   ];
   if (!date) {

      return days[new Date().getDay()]

   }
}
